DROP TABLE IF EXISTS "findinfo";
CREATE TABLE findinfo (
	id INTEGER NOT NULL, 
	player_id VARCHAR, 
	"key" VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(player_id) REFERENCES players (id)
);
DROP TABLE IF EXISTS "grades";
CREATE TABLE grades (
	id INTEGER NOT NULL, 
	correct INTEGER, 
	grade VARCHAR(64), 
	hint INTEGER, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "inventory";
CREATE TABLE inventory (
	id INTEGER NOT NULL, 
	player_code VARCHAR, 
	question_code INTEGER, 
	status VARCHAR(64), 
	hintflag INTEGER, 
	start_time DATETIME, 
	finish_time DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(player_code) REFERENCES players (id)
);
DROP TABLE IF EXISTS "players";
CREATE TABLE players (
	id VARCHAR NOT NULL, 
	name VARCHAR(64), 
	password VARCHAR(64), 
	nickname VARCHAR, 
	email VARCHAR(64), 
	gender VARCHAR(64), 
	age INTEGER, 
	point INTEGER, 
	questionstatus INTEGER, 
	grade VARCHAR(64), 
	hint INTEGER, 
	language INTEGER, 
	create_time DATETIME, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "profiles";
CREATE TABLE profiles (
	id INTEGER NOT NULL, 
	function_name VARCHAR(64), 
	execution_sec FLOAT, 
	create_time DATETIME, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "questions";
CREATE TABLE questions (
	question_code INTEGER NOT NULL, 
	region_code INTEGER, 
	train_code VARCHAR(64), 
	question_name VARCHAR(64), 
	line VARCHAR(64), 
	foreign_code VARCHAR(64), 
	x_coordinate FLOAT, 
	y_coordinate FLOAT, 
	question VARCHAR(64), 
	answer VARCHAR(64), 
	hint VARCHAR(64), 
	content_type VARCHAR(64), 
	PRIMARY KEY (question_code), 
	FOREIGN KEY(region_code) REFERENCES regions (region_code)
);
DROP TABLE IF EXISTS "questions_eng";
CREATE TABLE questions_eng (
	question_code INTEGER NOT NULL, 
	region_code INTEGER, 
	train_code VARCHAR(64), 
	question_name VARCHAR(64), 
	line VARCHAR(64), 
	foreign_code VARCHAR(64), 
	x_coordinate FLOAT, 
	y_coordinate FLOAT, 
	question VARCHAR(64), 
	answer VARCHAR(64), 
	hint VARCHAR(64), 
	content_type VARCHAR(64), 
	PRIMARY KEY (question_code), 
	FOREIGN KEY(region_code) REFERENCES regions_eng (region_code)
);
DROP TABLE IF EXISTS "regions";
CREATE TABLE regions (
	region_code INTEGER NOT NULL, 
	region_name VARCHAR(64), 
	"explain" VARCHAR(64), 
	PRIMARY KEY (region_code)
);
DROP TABLE IF EXISTS "regions_eng";
CREATE TABLE regions_eng (
	region_code INTEGER NOT NULL, 
	region_name VARCHAR(64), 
	"explain" VARCHAR(64), 
	PRIMARY KEY (region_code)
);
